import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <form
      method="POST"
      action="https://script.google.com/macros/s/AKfycbxwwvibaecSu4rTzZXjgXEB5p_XewtaH0hQBrgAsswkOvssZC99kxhqhhkwPjtpZpkOsA/exec"
    >
      <div>
        <input name="UserName" type="text" placeholder="UserName" required />
      </div>
      <div>
        <input name="MobNumber" type="text" placeholder="MobNumber" required />
      </div>
      <button type="submit">Send</button>
    </form>
  );
}

export default App;
